// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import Right from './pages/Right';

function App() {
  return (
    <>
      <header className="flex item-center justify-between">
        <nav className="flex items-center gap-8 text-primary font-semibold">
          <Link className="font-semibold text-2xl text-primary" href={'/'}>
          BREWTIFUL
          </Link>
          <Link href={'/'}>Home</Link>
          <Link href={''}>Menu</Link>
          <Link href={''}>About</Link>
        </nav>
        <nav className="flex items-center gap-4 text-primary font-semibold">
          <Link href={'/login'}>Login</Link>
          <Link href={'/register'} className="bg-primary rounded text-white px-8 py-2">
          Register</Link>
          <Link href={'/profile'}>Profile</Link>
        </nav>
      </header>
    </>
  );
}

export default App;
